import React from "react";
const MenuItems = ({title,id,imageUrl}) =>{
    return(
        <div style={{
            backgroundImage:`url($(imageUrl))`
        }} className="menu-item">
            <div className="content">
                <h1 className="title">JACKETS</h1>
                <span className="subtitle">SHOP NOW</span>
            </div>
        </div>
    )
}
export default MenuItems;
